import { NewQuiz } from './NewQuiz.js';

export function QuizPage(props) {
    let randomPlayers = [];
    for (let i = 0; i < 3; i++) {
        randomPlayers.push(players[Math.floor(Math.random() * players.length)]);
    }

    return (
        <div>
            <QuizCard players={randomPlayers} />
